import React, { useState } from 'react';



const App = () => {
    const state=useState()
    // console.log(state)
    const [count,setCount]=useState(0)
    const Incnum=()=>{
        setCount(1)
        console.log("Clicked")
    }
    return (
        <>
      <h1>{count}</h1>
      <button onClick={Incnum}>Click Me!</button>
        </>
    )
}
export default App;
